    "teammatesclosematches = np.where(np.isnan(teammatesclosematches), np.nan, teammatesclosematches.astype(int))\n",
    "\n",
    "# Initialize figure\n",
    "fig, axs = plt.subplots(figsize=(16,16*5/2), ncols = 2, nrows = 5)\n",
